	add("landammann", "{\"term\":\"landammann\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"swiss german\"], \"text\":\"From Swiss german \u0027lang\u003dde|landammann\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chief magistrate in certain cantons or other administrative districts in Switzerland\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1889,\u0027\u0027 Francis Ottiwell Adams and C. D. Cunningham, \u0027The Swiss Confederation\u0027,\u0026lt;sup\u0026gt;[http://books.google.com/books?id\u003d0VkBAAAAMAAJ]\u0026lt;/sup\u0026gt; Macmillan and Co., [http://books.google.com/books?id\u003d0VkBAAAAMAAJ\u0026amp;pg\u003dPA117\u0026amp;vq\u003dlandammann page 117\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There, on the first Sunday in May, the people assemble in a meadow at Bözlingen an der Gand, not far from Altdorf. The \u0027\u0027Landammann\u0027\u0027, after having duly attended mass in the village church, proceeds in procession to the place of meeting\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1891,\u0027\u0027 Lina Hug and Richard Stead, \u0027Switzerland\u0027, Second Edition,\u0026lt;sup\u0026gt;[http://books.google.com/books?id\u003dwIg2AAAAMAAJ]\u0026lt;/sup\u0026gt; T. Fisher Unwin (London) and G. P. Putnam\u0027s sons (New York), [http://books.google.com/books?id\u003dwIg2AAAAMAAJ\u0026amp;pg\u003dPA178\u0026amp;vq\u003dlandammann page 178\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"On the first Thursday in April, in solemn procession, they revisit the battlefield, and on the spot the \u0027\u0027Landammann\u0027\u0027 tells the fine old story of their deliverance from foreign rule, whilst priest and minister offer thanksgiving\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1922,\u0027\u0027 Charles Scott Fearenside (trans.), Eli Filip Heckscher and Harald Westergaard (auths.), \u0027The Continental System: An Economic Interpretation\u0027,\u0026lt;sup\u0026gt;[http://books.google.com/books?id\u003dSncNAAAAYAAJ]\u0026lt;/sup\u0026gt; H. Milford, [http://books.google.com/books?id\u003dSncNAAAAYAAJ\u0026amp;pg\u003dPA309\u0026amp;dq\u003dlandammann page 309\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027Landammann\u0027\u0027 (President) summed up the situation in April 1812, in the distressful proposition that \u0027the industries of Switzerland are now nearing their end\u0027; and a considerable emigration took place, among other places, to the left bank of the Rhine\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004,\u0027\u0027 Derek Benjamin Heater, \u0027A Brief History of Citizenship\u0027,\u0026lt;sup\u0026gt;[http://books.google.com/books?id\u003dc-falFSTRQwC]\u0026lt;/sup\u0026gt; NYU Press, ISBN 0814736726, page 97\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"For example, in the w:Canton of canton of Uri, the villagers elected a \u0027\u0027\u0027Landammann\u0027\u0027\u0027 (chief magistrate) each year, yet only a limited number of families supplied candidates\", \"priority\":9}]}, \"synonyms\":{}}");

