	add("landlordism", "{\"term\":\"landlordism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|landlord|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An economic system under which a few private individuals (landlords) own property, and rent it to tenants\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1907\u0027\u0027, Jack London, \u0027The Iron Heel\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"What if all the poor people should refuse to pay rent and shelter themselves under the American flag? \u0027\u0027Landlordism\u0027\u0027 would go crumbling\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A specific variation or implementation of such a system\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Reclaiming the land: the resurgence of rural movements in Africa, Asia, and Latin America\u0027, edited by Sam Moyo and Paris Yeros, page 33\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"including the racialized \u0027\u0027landlordisms\u0027\u0027 to which it gives rise\", \"priority\":6}]}, \"synonyms\":{}}");

