	add("landrace", "{\"term\":\"landrace\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any local variety of a domesticated animal or plant species that has adapted over time to its ecological and cultural environment (including, in some cases, its work\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, \u0027Breeds of Swine\u0027, Farmers\u0027 Bulletin No. 1263, US Department of Agriculture, [http://books.google.com.au/books?id\u003dWGDpsvfdVPwC\u0026amp;pg\u003dPA7\u0026amp;dq\u003d%22landrace%22%7C%22landraces%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsIauU-LpGI2_kQXY8YG4Bw\u0026amp;ved\u003d0CIwBEOgBMB\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22landrace%22%7C%22landraces%22\u0026amp;f\u003dfalse page 7\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One of the newer breeds of swine in the United States is the American \u0027\u0027Landrace\u0027\u0027. American \u0027\u0027Landrace\u0027\u0027 hogs (figs. 19 and 20) are descendants of Danish \u0027\u0027Landrace\u0027\u0027 hogs imported by the United States Department of Agriculture in 1934\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Pablo Eyzaguirre, Arwen Bailey, \u0027International case studies and tropical home gardens projects: offering lessons for a new research agenda in Europe\u0027, A. Bailey, Pablo B. Eyzaguirre, L. Maggioni, \u0027Crop genetic resources in European home gardens: Proceedings of a Workshop\u0027, [http://books.google.com.au/books?id\u003dC4SVZ-kmSqYC\u0026amp;pg\u003dPA1\u0026amp;dq\u003d%22landrace%22%7C%22landraces%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsIauU-LpGI2_kQXY8YG4Bw\u0026amp;ved\u003d0CP4BEOgBMC\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22landrace%22%7C%22landraces%22\u0026amp;f\u003dfalse page 1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"First, many crop \u0027\u0027landraces\u0027\u0027 in Europe are being lost without our even knowing what is being lost\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, A. C. Newton, \u0027et al.\u0027, \u0027Cereal \u0027\u0027Landraces\u0027\u0027 for Sustainable Agriculture\u0027, Eric Lichtfouse, Marjolaine Hamelin, Philippe Debaeke, Mireille Navarrete (editors), \u0027Sustainable Agriculture\u0027, Volume 2, [http://books.google.com.au/books?id\u003dlbxM4KocWugC\u0026amp;pg\u003dPA154\u0026amp;dq\u003d%22landrace%22%7C%22landraces%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsIauU-LpGI2_kQXY8YG4Bw\u0026amp;ved\u003d0CG0Q6AEwD\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22landrace%22%7C%22landraces%22\u0026amp;f\u003dfalse page 154\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"In both cases the morphological diversity within the oat accessions did not differ between \u0027\u0027landraces\u0027\u0027 and modern cultivars\", \"priority\":10}]}, \"synonyms\":{}}");

	add("landrush", "{\"term\":\"landrush\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|land|rush|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A historical event in which previously restricted land of the United States was opened for homesteading on a first-come-first-served basis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1967\u0027\u0027, Roger G Kennedy, \u0027Minnesota Houses\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It never knew a boom and was relatively untouched by the great \u0027\u0027landrush\u0027\u0027 of the 1850\u0027s\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Susan Hayward, \u0027Cinema Studies\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027landrush\u0027\u0027 to all intents and purposes made the cowboy defunct\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Any scramble for limited resources\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, United States Congress, \u0027ICANN, New GTLDS, and the Protection of Intellectual Property\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In the event that an applicant obtains the domain name in question through the \u0027\u0027Landrush\u0027\u0027 process described below, the service will be activated\", \"priority\":8}]}, \"synonyms\":{}}");

	add("landscape", "{\"term\":\"landscape\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"Icelandic\", \"low german\", \"Dutch\", \"old dutch\", \"scots\", \"Swedish\"], \"text\":\"From an alteration (due to Dutch \u0027landschap\u0027 of earlier \u0027landskip\u0027 \u0027lantschip\u0027 from Middle english (1100-1500) {{m|enm|*landschippe}}, {{m|enm|*landschapp}}, from Old english (ca. 450-1100) \u0027landscipe\u0027 \u0027landsceap\u0027 (region, district, tract of land) equivalent to {{suffix|land|ship|lang\u003den}}; in some senses from Dutch \u0027landschap\u0027 (region, district, province, landscape) from Middle dutch (ca. 1050-1350) \u0027landscap\u0027 \u0027lantscap\u0027 (region) from Old dutch {{m|odt|*landskepi}}, {{m|odt|*landskapi||region}}. Cognate with Scots \u0027landskape\u0027 \u0027landskep\u0027 \u0027landskip\u0027 (landscape) West frisian \u0027lânskip\u0027 (landscape) Low german \u0027landschop\u0027 (landscape, district) German \u0027landschaft\u0027 (landscape, countryside, scenery) Swedish \u0027landskap\u0027 (landscape, scenery, province) Icelandic \u0027landskapur\u0027 (countryside)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Landscape thumb|right|Landscape layout for printin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A portion of land or territory which the eye can comprehend in a single view, including all the objects it contains\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A picture representing a scene by land or sea, actual or fancied, the chief subject being the general aspect of nature, as fields, hills, forests, water. etc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The pictorial aspect of a country\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a mode of printing where the horizontal sides are longer than the vertical side\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A space, indoor or outdoor and natural or man-made (as in \u0026quot;designed \u0027\u0027landscape\u0027\u0027\u0026quot\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a situation that is presented, a scenari\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The software patent \u0027\u0027landscape\u0027\u0027 has changed considerably in the last years\", \"priority\":8}]}, \"synonyms\":{}}");

