	add("landwhale", "{\"term\":\"landwhale\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|land|whale|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An obese person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, John J. Burke IV, \u0026quot;One male\u0027s opinion\u0026quot; [letter to the editor], \u0027The Pointer\u0027 (University of Wisconsin, Stevens Point), Volume 29, Number 13, 21 November 1985, [http://epapers.uwsp.edu/pointers/1985/1985%20Nov%2021.pdf page 28\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There is nothing else to hit on here except fat girls so the \u0027\u0027landwhales\u0027\u0027 just assume that since they have no problem getting dates that it\u0027s all right to be fat\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0026quot;[http://issuu.com/skinnie_magazine/docs/skinnieoct06 Hearsay]\u0026quot;, \u0027Skinnie Magazine\u0027, October 2006, page 24\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"That\u0027s less lazy people getting Social Security, or taking jobs that us normal-sized people need. Eat yourself to death, \u0027\u0027landwhales\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Brock Barrack, \u0027Touch Wood\u0027, iUniverse (2010), ISBN 9781450270052, [https://books.google.com/books?id\u003dsy-hWqija_gC\u0026amp;pg\u003dPT342\u0026amp;dq\u003d%22landwhales%22 unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Captain guy was talking now. Sounded official. Trim build. Looked in good shape for someone in his fifties. From what he could scope out. Interesting. Not all Americans were \u0027\u0027landwhales\u0027\u0027 by thirty\", \"priority\":7}]}, \"synonyms\":{}}");

