	add("languet", "{\"term\":\"languet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) {{m|fro|languete}} (modern French {{m|fr|languette}}), diminutive of {{m|fro|langue||tongue}}, from Latin {{m|la|lingua}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tongue-shaped implement, specifically\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A narrow blade on the edge of a spade or shovel\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A piece of metal on a sword-hilt which overhangs the scabbard\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A flat plate in (or opposite and below the mouth of) the pipe of an organ\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, Thomas Pynchon, \u0027Gravity\u0027s Rainbow\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"If there is music for this it’s windy strings and reed sections standing in bright shirt fronts and black ties all along the beach, a robed organist by the breakwater—itself broken, crusted with tides—whose \u0027\u0027languets\u0027\u0027 and flues gather and shape the resident spooks here\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A narrow tongue of land\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A tongue-like organ found on certain tunicates\", \"priority\":8}]}, \"synonyms\":{}}");

