	add("langur", "{\"term\":\"langur\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hindi\", \"Sanskrit\", \"Urdu\"], \"text\":\"From Hindi and Urdu \u0027लंगूर\u0027 / \u0027لنگور\u0027 from Sanskrit \u0027लाङ्गूलिन्\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the Old World monkeys of the subfamily Colobinae, in the genera \u0027Simias\u0027, \u0027Trachypithecus\u0027 (lutungs), \u0027Presbytis\u0027, (surilis), and \u0027Semnopithecus\u0027, (gray langurs\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A gibbon of the genus \u0027Hoolock\", \"priority\":2}]}, \"synonyms\":{}}");

	add("lanolin", "{\"term\":\"lanolin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Former trademark, from {{suffix|lana|in|t1\u003dwool|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A greasy yellow substance chemically akin to wax that is secreted from wooly animals, with a variety of uses from rust prevention, lubrication and waterproofing to cosmetics and skin ointments\", \"priority\":1}]}, \"synonyms\":{}}");

	add("lansquenet", "{\"term\":\"lansquenet\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"French\"], \"text\":\"From French \u0027lansquenet\u0027 from German \u0027landsknecht\u0027 from \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of a class of German mercenaries in the 16th and 17th centuries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1960\u0027\u0027, AM Holt, translating Gottfried Keller, \u0027Green Henry\u0027, Calder Publications 2010, p.440\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"arising out of this festival there was established an individual \u0027\u0027lansquenet\u0027\u0027 tradition, in speech and outward appearance, and the bare, sunburnt necks of the vagabond soldiers, their baggy garments hanging in shreds, and their short swords, could be seen all over the country for long afterwards\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A card game, used for gambling\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"“I\u0027m through with all pawn-games,” I laughed. “Come, let us have a game of \u0027\u0027lansquenet\u0027\u0027. Either I will take a farewell fall out of you or you will have your sevenfold revenge”\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One could see part of the dimly lit court where under an enclosed poplar two soldiers on a stone bench were playing \u0027\u0027lansquenet\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Choderlos de Laclos, \u0027Dangerous Liaisons\u0027, tr. Helen Constantine, p.196\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"And so it was over the game of \u0027\u0027\u0027lansquenet\u0027\u0027\u0027 that I scored my first triumph\", \"priority\":8}]}, \"synonyms\":{}}");

	add("lanterloo", "{\"term\":\"lanterloo\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"French \u0027lanturlu\u0027 originally the refrain of a sixteenth-century song.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A meaningless chant or refrain\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027: The helmsman began to sing a monotonous, Levantine \u0027\u0027lanterloo\u0027\u0027. — Thomas Pynchon, \u0027V\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A trick-taking card game popular in 17th century England, where each player is dealt three or five cards\", \"priority\":3}]}, \"synonyms\":{}}");

	add("lantern", "{\"term\":\"lantern\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"Middle English (13th century), via Old french (842-ca. 1400) \u0027lanterne\u0027 from Latin \u0027lanterna\u0027 (lantern) itself a corruption of Ancient greek (to 1453) \u0027λαμπτήρ\u0027 (torch) (see lamp, λάμπω) by influence of Latin \u0027lucerna\u0027 (lamp) The spelling \u0027lanthorn\u0027 was current during the 16th to 19th centuries and originates with a folk etymology associating the word with the use of horn as translucent cover. For the verb, compare French \u0027lanterner\u0027 to hang at the lamp-post.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A case of translucent or transparent material made to protect a flame, or light, used to illuminate its surroundings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Especially, a metal casing with lens used to illuminate a stage (e.g. spotlight, floodlight\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An open structure of light material set upon a roof, to give light and air to the interior\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A cage or open chamber of rich architecture, open below into the building or tower which it crowns\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A smaller and secondary cupola crowning a larger one, for ornament, or to admit light\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"the lantern of the cupola of the Capitol at Washington, or that of the Florence cathedral\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A lantern pinion or trundle wheel\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A kind of cage inserted in a stuffing box and surrounding a piston rod, to separate the packing into two parts and form a chamber between for the reception of steam, etc.; a lantern brass\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A perforated barrel to form a core upon\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Aristotle\u0027s lantern\", \"priority\":10}]}, \"synonyms\":{}}");

	add("lanugo", "{\"term\":\"lanugo\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027lana\u0027 (wool)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Soft down or fine hair, specifically that covering the human foetus or a tumorous are\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1955\u0027\u0027, early spring mountains with young-elephant \u0027\u0027lanugo\u0027\u0027 along their spines — Vladimir Nabokov, \u0027Lolita\u0027Category:en:Hair\", \"priority\":2}]}, \"synonyms\":{}}");

	add("lanyard", "{\"term\":\"lanyard\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"German\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"old norse\"], \"text\":\"From Middle english (1100-1500) \u0027lanyer\u0027 from Middle french (ca. 1400-1600) \u0027laniere\u0027 from Old french (842-ca. 1400) \u0027lasniere\u0027 (thong, lash) from \u0027lasne\u0027 (strap, thong) alteration of \u0027nasle\u0027 (strap, thong) from Frankish {{m|frk|*nastila||tie, headband}}, from Proto-germanic {{m|gem-pro|*nastilō||tie, thread, strap}}, from Proto-indo-european {{m|ine-pro|*nedh-||to tie together}}. Cognate with Old high german (ca. 750-1050) \u0027nestila\u0027 (band, headband, strap) Old english (ca. 450-1100) \u0027nostle\u0027 Old norse \u0027nesta\u0027 (brace, strap, fastener) German \u0027nestel\u0027 (string, strap, lace)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short rope used for fastening rigging\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A cord used to hold a small object such as a key, whistle, card, or knife, worn around the neck or wrist: a form of necklace or wristband\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A cord with a hook; once used to fire artillery\", \"priority\":3}]}, \"synonyms\":{}}");

